function executeUnitTests(){QUnit.config.scrolltop=false;QUnit.test("2D to 1D transformations",function(a){var c=transform2Dto1D(new Coordinate(1,4),8);a.ok(c,12,"Passed!");try{var c=transform2Dto1D(new Coordinate(8,4),8)}catch(b){a.ok(c,"Array out of Index","Passed!")}});QUnit.test("1D to 2D transformations",function(b){var d=transform1Dto2D(19,8);var a=new Coordinate(2,3);b.deepEqual(d,a,"Passed!");try{var d=transform1Dto2D(64,8)}catch(c){b.ok(d,"Array out of Index","Passed!")}});QUnit.test("Node functionalities",function(a){var b=new Node(new Coordinate(3,4),null);a.equal(b.getCoordinate().getRow(),3,"Passed!");a.equal(b.getCoordinate().getColumn(),4,"Passed!");a.equal(b.getCell(),null,"Passed")});QUnit.test("Square Map functionalities",function(b){var a=createCellDiv("test");var d=new SquareMap(10);var c=new Node(new Coordinate(2,3),a);d.setNode(new Coordinate(2,3),c);b.deepEqual(d.getNode(new Coordinate(2,3)).getCell(),a,"Passed!")});QUnit.test("Euclidean Heuristic",function(a){var c=new Coordinate(2,7);var b=new Coordinate(1,3);a.equal(heuristicCost(c,b),Math.sqrt(17),"Passed!")})};